const initialState = {
  createOwner: [],
  restaurantDetails: [],
  menu: [],
  addMenu: [],
  deleteMenuItem: [],
  ownerProfile: [],
  nameUpdate: [],
  emailUpdate: [],
  passwordlUpdate: [],
  restaurantUpdate: []
};

const ownerReducer = (state = initialState, action) => {
  switch (action.type) {
    case "CREATE_OWNER":
      return {
        ...state,
        createOwner: action.payload
      };
    case "RESTAURANT_DETAILS":
      return {
        ...state,
        restaurantDetails: action.payload
      };
    case "MENU":
      return {
        ...state,
        menu: action.payload
      };
    case "ADD_MENU":
      return {
        ...state,
        addMenu: action.payload
      };
    case "DELETE_MENU":
      return {
        ...state,
        deleteMenuItem: action.payload
      };
    case "OWNER_PROFILE":
      return {
        ...state,
        ownerProfile: action.payload
      };
    case "OWNER_NAME_UPDATE": {
      return {
        ...state,
        nameUpdate: action.payload
      };
    }
    case "OWNER_EMAIL_UPDATE": {
      return {
        ...state,
        emailUpdate: action.payload
      };
    }
    case "OWNER_PASSWORD_UPDATE": {
      return {
        ...state,
        passwordlUpdate: action.payload
      };
    }
    case "RESTAURANT_DETAILS_UPDATE": {
      return {
        ...state,
        restaurantUpdate: action.payload
      };
    }
    case "RESTAURANT_DETAILS_ID":
      return {
        ...state,
        restaurantDetails: action.payload
      };
    default:
      return state;
  }
};

export default ownerReducer;
